        replaceURLWithHTMLLinks: function(sText, bBlank) {
            var pattern = /(\b(https?|ftp|file):\/\/[-A-Z0-9+&@#\/%?=~_|!:,.;]*[-A-Z0-9+&@#\/%=~_|])/ig;
            if (bBlank) {
                sText = sText.replace(pattern, "<a target='_blank' href='$1'>$1</a>")
            } else {
                sText = sText.replace(pattern, "<a href='$1'>$1</a>")
            }
            return sText
        },
