    SFWapList.prototype.loadData = function(down) {
        if (this.pullRefresh) {
            if (down) {
                this.currentDisplayLength = this.displayLength
            }
        }
        var params = "";
        if (!this.isMenu) {
            params = "bSortable_0=false&bSortable_1=" + (this.hasCheckAllInPc ? "false" : "true") + "&iSortingCols=" + this.sort.length + "&iDisplayStart=0&iDisplayLength=" + this.currentDisplayLength;
            for (var k in this.sort) {
                if (this.sort[k].length == 2) {
                    var col = this.sort[k][0];
                    var dir = this.sort[k][1];
                    params += "&iSortCol_" + k + "=" + col + "&sSortDir_" + k + "=" + dir
                }
            }
        }
        if (this.data) {
            var dataStr = "";
            var _type = typeof this.data;
            if (_type == "string") {
                dataStr = this.data
            } else {
                if (_type == "function") {
                    dataStr = this.data()
                }
            }
            try {
                var dataJson = JSON.parse(dataStr);
                for (var key in dataJson) {
                    params += "&" + key + "=" + dataJson[key]
                }
            } catch (e) {
                params += "&" + dataStr
            }
        }
        if (this.withSearch) {
            params += "&query_param=" + $("#" + this.dataListId + "_query").val() + "&query_wap=1"
        }
        var that = this;
        $.get(this.url, params, function(data) {
            var callback = that.callback;
            if (callback) {
                var _type = typeof callback;
                if (_type == "string") {
                    eval(callback + "(" + data + ")")
                } else {
                    if (_type == "function") {
                        callback(data)
                    }
                }
            }
            var total = data.iTotalRecords;
            var length = data.iDisplayLength;
            that.currentDisplayLength = length + that.displayLength;
            if (that.pullRefresh) {
                if (down) {
                    mui(that.container).pullRefresh().endPulldownToRefresh();
                    mui(that.container).pullRefresh().refresh(true)
                } else {
                    mui(that.container).pullRefresh().endPullupToRefresh(total <= length)
                }
            }
            if (total == 0) {
                SFWapListUtil.promptNoData(that.dataListId)
            }
        })
    }
