    var SFWapListUtil = {
        loadBadge: function(ztmc, defaultStyle) {
            var c = defaultStyle || "";
            if (ztmc == "") {
                c = SFWapList.YELLOW
            } else {
                if (ztmc == "") {
                    c = SFWapList.RED
                } else {
                    if (ztmc == "" || ztmc == "") {
                        c = SFWapList.GREEN
                    }
                }
            }
            return '<span class="mui-badge mui-badge-' + c + '">' + ztmc + "</span>"
        },
        loadOpsBtn: function(text, style, isDisabled, clickFuncName, param1, param2, param3) {
            style = style != null ? "mui-btn-" + style : "";
            var disabledSTyle = isDisabled ? "mui-disabled" : "";
            var href = "";
            param1 = param1 || "";
            param2 = param2 || "";
            param3 = param3 || "";
            if (!isDisabled && clickFuncName) {
                href = 'href="javascript:' + clickFuncName + "('" + param1 + "', '" + param2 + "', '" + param3 + "')\""
            }
            return '<a class="mui-btn ' + style + " " + disabledSTyle + '" ' + href + ">" + text + "</a>"
        },
        promptNoData: function(id) {
            $("#" + id).append("<div class='text-center' style='background-color:#efeff4'><img style='width:150px;margin-top:100px' src='wap/images/nodata.png'/></div>");
            $("#" + id).append("<div class='text-center' style='background-color:#efeff4;'><p>~~</p></div>");
            if (!$("#" + id).hasClass("mui-table-view-noborder")) {
                $("#" + id).addClass("mui-table-view-noborder")
            }
        },
        del: function(dm, url, callback, oper) {
            oper = oper || "";
            SFWapListUtil.op(dm, url, oper, callback, "POST")
        },
        op: function(dm, url, oper, callback, ajaxType) {
            ajaxType = ajaxType || "POST";
            $.confirm({
                content: "" + oper + "?",
                confirm: function() {
                    $.ajax({
                        url: url,
                        data: "dm=" + dm,
                        type: ajaxType,
                        success: function(response) {
                            if (response == "1" || response == true || response.result) {
                                SFAlert.opSuccess();
                                if (callback) {
                                    jutil.callFunc(callback)
                                }
                            } else {
                                SFAlert.opFail()
                            }
                        }
                    })
                }
            })
        },
    };
